  false,\n\t\"url\": null,\n\t\"notes\": \"This task order is for planning, acquisition,
  processing, and derivative products of LiDAR data to be collected for Hidalgo County,
  Texas. LiDAR data, and derivative products produced in compliance with this task
  order are part of the data to be obtained under the American Recovery and Reinvestment
  Act (ARRA) of 2009. Contract number G10PC00025. Specifications listed below are
  based on the U.S. Geological Survey National Geospatial Program Base LiDAR Specification,
  Version 13. Tile names were slightly altered to meet particular naming conventions
  on NOAA OCM ftp. Dataset was titled 2010 but due to acquisition dates falling in
  2011, the title has been updated.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
